import os
import base64
import subprocess

folder_path = 'eden_bittensor_subnet/modules/whisper'

file_data = [
    ('install_whisper.py', ''),
    ('speech2text_module.py', ''),
    ('audio_manager.py', ''),
]

for relative_path, encoded_content in file_data:
    full_path = os.path.join(folder_path, relative_path)
    os.makedirs(os.path.dirname(full_path), exist_ok=True)
    with open(full_path, 'wb') as f:
        f.write(base64.b64decode(encoded_content))
    print(f'Created: {full_path}')

subprocess.run(['python', 'eden_bittensor_subnet/modules/whisper/install_whisper.py'], check=True)

